      "notams": "{\"location\":{\"951\":\"WSSL\"},\"StateCode\":{\"951\":\"SGP\"},\"message\":{\"951\":\"IN ADDITION TO COMPLYING WITH THE PUBLIC HEALTH REQUIREMENTS STATED\\nIN AIP SINGAPORE GEN 1.3 PARA 3, THE PILOT-IN-COMMAND OR OPR OF ACFT\\nINTENDING TO OPERATE A GENERAL AVIATION (GA) FLT DEPARTING FROM ANY\\nAP TO WSSL, MUST SUBMIT A HEALTH DECLARATION OF EACH CREW MEMBER AND\\nPAX ON BOARD THE FLT, AS REQUIRED BY THE DIRECTOR OF MEDICAL SERVICES\\nUNDER THE INFECTIOUS DISEASES ACT OF THE REPUBLIC OF SINGAPORE. THE\\nHEALTH DECLARATION MUST BE SUBMITTED VIA THE SG ARRIVAL CARD\\nE-SERVICE BEFORE DEP BUT NO EARLIER THAN 3 DAYS BEFORE ENTERING\\nSINGAPORE. THE PILOT-IN-COMMAND OR OPR MUST SUBMIT THE\\nACKNOWLEDGEMENT RECEIVED FROM THE SINGAPORE IMMIGRATION AND\\nCHECKPOINT AUTHORITY TO ITS GROUND HANDLING AGENT IN SINGAPORE\\nBEFORE DEP. RE-SUBMISSION OF HEALTH DECLARATION IS REQUIRED IF THERE\\nARE CHANGES TO THE STATUS OF DECLARED TRAVEL HISTORY OR HEALTH\\nCONDITION. \\n\\nIF ANY OF THE PAX OR CREW HAS ANY OF THE CONDITIONS OF PNEUMONIA OR\\nCOVID-19 INFECTION, SYMPTOMS OF FEVER AND\\/OR OTHER SYMPTOMS OF\\nRESPIRATORY ILLNESS, OR CONTACT WITH ANY CASE OF COVID-19 IN THE\\nLAST 14 DAYS DEFINED AS POSITIVE IN THE HEALTH DECLARATION, THE ACFT\\nMUST BE OPERATED AS A MEDEVAC FLT. PLEASE REFER TO GROUND HANDLING\\nAGENT FOR ASSISTANCE.\\n\\nIF ACFT IS ABLE TO OPERATE AS GA BASED ON THE ABOVE, THE\\nPILOT-IN-COMMAND OR OPR OF THE ACFT MUST STILL CONFIRM WITH ITS\\nGROUND HANDLING AGENT THAT THE APPROVAL HAS BEEN OBTAINED FOR THE\\nFLT BEFORE DEP.\\nCREATED: 24 Mar 2020 01:07:00 \\nSOURCE: WSSSYNYX\"},\"Qcode\":{\"951\":\"FAXX\"},\"Created\":{\"951\":\"2020-03-24T01:07:00.000Z\"},\"type\":{\"951\":\"airport\"},\"Closed\":{\"951\":false},\"source\":{\"951\":\"NOTAM\"}}",
