      "notams": "{\"location\":{\"615\":\"HRYR\"},\"StateCode\":{\"615\":\"RWA\"},\"message\":{\"615\":\"FOLLOWING THE DECLARATION OF WHO, MINISTRY OF HEALTH RECOMMENDS PREVENTIVE MEASURES TO PROTECT ALL RESIDENTS AND VISITORS OF RWANDA.\\nTHESE ARE INSTRUCTIONS TO FOLLOW AT ALL PORTS OF ENTRY ACROSS THE COUNTRY\\n1.ALL TRAVELERS ARRIVING IN RWANDA AT ALL POINTS OF ENTRY WILL BE SCREENED\\n2.ALL TRAVELLERS PRESENTING ONE OF THE COVID-19 SYMPTOMS AND COMING FROM COUNTRIES WITH CONFIRMED CASES OF COVID-19 WILL BE CONSIDERED AS SUSPECT CASES AND WILL BE ISOLATED FOR FURTHER INVESTIGATIONS AND LABORATORY TESTING PROCEDURES IN THE NEAREST HOSPITAL\\n3.SUSPECTED CASE,WHEN CONFIRMED WILL BE SENT IMMEDIATELY TO COVID-19 TREATMENT CENTER.\\n4.IF TESTED NEGATIVE,SUSPECTED CASE REMAINS ELIGIBLE FOR ACTIVE FOLLOW UP AND THEREFORE HE\\/SHE WILL BE ADVISED TO PROVIDE FULL IDENTIFICATION FOR CONTINUED DAILY MONITORING AT PLACE OF SELF-QUARANTINE FOR 14 DAYS COUNTED FROM THE DAY HE\\/SHE LEFT THE COUNTRY WITH COVID-19 CASES.THE LOCATION OF THE SUSPECTED CASES HAS TO BE ACCESSIBLE BY MOH-RBC\\n5.SUSPECTED CASE IN SELF-QUARANTINE CONDITIONS MUST ABIDE BY THE FOLLOWING CONDITIONS: WEAR MASKS ALL TIME,SELF-ISOLATE FROM OTHERS IN THE SAME HOUSEHOLD AND CALL 114 FOR FURTHER DIRECTION.\\n6.ANY ASYMPTOMATIC TRAVELLER COMING FROM COUNTRIES WITH CONFIRMED COVID-19 CASES WILL BE CONSIDERED AT RISK,AND WILL BE RECORDED IN A REGISTER AND ELECTRONIC TOOLS FOR CONTINUED DAILY MONITORING FOR 14 DAYS COUNTED FROM THE DAY HE\\/SHE LEFT COUNTRY WITH COVID-19 CASES.\\nPART 1 OF 2\\nCREATED: 09 Mar 2020 16:52:00 \\nSOURCE: HRYRYNYX\"},\"Qcode\":{\"615\":\"OEXX\"},\"Created\":{\"615\":\"2020-03-09T16:52:00.000Z\"},\"type\":{\"615\":\"airspace\"},\"Closed\":{\"615\":false},\"source\":{\"615\":\"NOTAM\"}}",
