      "notams": "{\"location\":{\"878\":\"TKPN\",\"879\":\"TKPN\"},\"StateCode\":{\"878\":\"KNA\",\"879\":\"KNA\"},\"message\":{\"878\":\"AD OPR HR CHANGED DUE TO COVID-19 PANDEMIC\\nCREATED: 08 May 2020 18:14:00 \\nSOURCE: TTPPYNYX\",\"879\":\"DUE TO THE COVID-19 OUTBREAK, THE GOVERNMENT OF ST. KITTS-NEVIS \\nHAS UPDATED ITS TRAVEL ADVISORY WITH IMMEDIATE EFFECT TO DENY ENTRY \\nTO NON-CITIZENS AND NON-RESIDENTS WHO HAVE TRAVELLED TO CHINA, IRAN, \\nHONG KONG, SINGAPORE, SOUTH KOREA, JAPAN, EUROPE, THE UNITED KINGDOM \\nAND THE UNITED STATES OF AMERICA. \\nNATIONALS AND LEGAL CITIZENS OF THE FEDERATION ARE STRONGLY ADVISED \\nTO AVOID ALL NON-ESSENTIAL TRAVEL TO COUNTRIES OR JURISDICTIONS WHERE\\nCOVID-19 CASES HAVE BEEN REPORTED AND WHERE THERE IS LOCAL\\/COMMUNITY \\nTRANSMISSION. \\nNATIONALS AND LEGAL CITIZENS OF ST. KITTS-NEVIS ARRIVING FROM THE \\nAFOREMENTIONED DESTINATIONS OR ANY OTHER DESTINATION WILL BE SUBJECT \\nTO ENTRY SCREENING AND A MANDATORY FOURTEEN (14) DAY QUARANTINE \\nPERIOD UPON ARRIVAL. \\nALL NON-NATIONAL TRAVELLERS ARRIVING FROM ANY OTHER INTERNATIONAL \\nDESTINATION: \\n1) WILL GO THROUGH AN ADVANCED SCREENING PROCESS AT POINT OF ENTRY, \\nREGARDLESS OF YOUR POINT OF ORIGIN \\n2) WILL BE SUBJECTED TO A MANDATORY QUARANTINED PERIOD OF NOT LESS \\nTHAN FOURTEEN (14) DAYS AT A GOVERNMENT DESIGNATED QUARANTINE SITE \\n3) WILL RECEIVE HEALTH CHECKS BY THE MINISTRY OF HEALTH'S DESIGNATED \\nQUARANTINE OFFICIALS ON A DAILY BASIS \\n4) MAY BE REFUSED ENTRY\\nCREATED: 24 Mar 2020 13:08:00 \\nSOURCE: TTPPYNYX\"},\"Qcode\":{\"878\":\"FAAH\",\"879\":\"XXXX\"},\"Created\":{\"878\":\"2020-05-08T18:14:00.000Z\",\"879\":\"2020-03-24T13:08:00.000Z\"},\"type\":{\"878\":\"airport\",\"879\":\"airport\"},\"Closed\":{\"878\":false,\"879\":false},\"source\":{\"878\":\"NOTAM\",\"879\":\"NOTAM\"}}",
