      "notams": "{\"location\":{\"918\":\"VLVT\",\"919\":\"VLVT\"},\"StateCode\":{\"918\":\"LAO\",\"919\":\"LAO\"},\"message\":{\"918\":\"AS THE COVID-19 VIRUS IS SPREADING WIDELY ACROSS THE WORLD, THE\\nDEPARTMENT OF CIVIL AVIATION OF LAO PDR(DCAL)WOULD LIKE TO SEEK YOUR\\nCOOPERATION IN CONDUCTING THE FOLLOWING ACTIONS:\\n1. ALL CREW MEMBERS AND PASSENGER OF FOREIGN AIRLINES SHALL UNDERGO A\\nTHERMAL SCANNING AT THE PORT OF EMBARKATION PRIOR BOARDING THE\\nACFT AND LAND AT THE ALL INTERNATIONAL AIRPORTS IN LAO PDR. ALL\\nCREWS AND PASSENGERS WHO HAVE CERTAIN SIGNS AND SYMPTOMS.\\n2. CREWS AND PASSENGERS WHEN ARRIVE AT LAO PDR INTERNATIONAL AIRPORTS\\nWHICH FOUND THE BODY TEMPERATURE IS HIGHER THAN 37.5 CELSIUS WITH THE\\nFEVER AND SUFFER FROM THE SYMPTOMS THAT DEFINED UNDER THE COVID-19\\nSHALL BE TRANSPORTED TO THE DESIGNATED HOSPITAL FOR MONITORING AND\\nFURTHER MEDICAL EVALUATION FOR COVID-19.\\n3. ALL CREW MEMBERS AND PASSENGERS ARRIVED AT LAO PDR INTERNATIONAL\\nAIRPORT SHOWING NO SYMPTOMS OF CORONAVIRUS ARE ENCOURAGED TO COMPLETE\\nTHE RECOMMENDED 14-DAYS SELF-MONITORING PERIOD AND WEARING SURGICAL\\nFACE MASKS WHEN VISITING CROWDED OR PUBLIC AREAS.\\nEND PART 1 OF 2\\nCREATED: 03 May 2020 02:22:00 \\nSOURCE: VLVTYNYX\",\"919\":\"REFERENCE IS MADE TO PRIME MINITER ORDER,NO.06\\/PMO DATED 29 MARCH\\n2020,THE DEPARTMENT OF CIVIL AVIATION (DCA) IS PLEASED TO NOTIFY ON\\nTHE RESTRICTIONS TO REDUCE THE RISK OF IMPORTATION AND PANDEMIC OF\\nTHE CORONAVIRUS (COVID-19) AND THE RESTRICTIONS ARE AS FOLLOWS:\\n1.SUSPENSION ALL INTERNATIONAL COMMERCIAL OF SCHEDULE AND\\nNON-SCHEDULE OF PASSENGER FLIGHTS TO LAO PDR FROM 4-19 APRIL 2020\\nEXCEPT TO THE COMMERCIAL AIR CARGO FLIGHT.\\n2.RESTRICTION IS NOT APPLICABLE TO HUMANITARIAN RELIEF AND DIPLOMAT,\\nREPATRIATE FLIGHT BUT THE REQUEST SHALL BE SUBMITTED TO MINISTRY OF\\nFOREIGN AFFAIRS THROUGH THE DIPLOMATIC CHANNEL FOR ENTRY PERMIT.\\n3.EXEMPTION IS APPLIED TO THE EMERGENCY LANDING AND TECHNICAL STOP\\nFOR REFUELING UNDER NO DISEMBARKATION OF CREWS AND PASSENGERS.IF\\nDISEMBARKATION IS REQUESTED,THE AIRCRAFT WILL BE ASSIGNED AT THE\\nDESIGNATION ISOLATED PARKING SPOT AND FOLLOW PREVENTIVE INSTRUCTION\\nFROM AIRPORT HEALTH AUTHORITY.\\nCREATED: 03 May 2020 02:12:00 \\nSOURCE: VLVTYNYX\"},\"Qcode\":{\"918\":\"AFXX\",\"919\":\"AFXX\"},\"Created\":{\"918\":\"2020-05-03T02:22:00.000Z\",\"919\":\"2020-05-03T02:12:00.000Z\"},\"type\":{\"918\":\"airspace\",\"919\":\"airspace\"},\"Closed\":{\"918\":false,\"919\":false},\"source\":{\"918\":\"NOTAM\",\"919\":\"NOTAM\"}}",
